import React from 'react';
import Slider from "react-slick";
 import { Accordion } from "flowbite-react"
 
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Uber from '../assets/uber.png';
import Tules from '../assets/telus.png';
import Du from '../assets/du.png';
import Accenture from '../assets/accenture.png';
import Emirates from '../assets/emirates.png';
import Dubai from '../assets/dubai.png';
import Photo13 from '../assets/photo13.png';
import Photo14 from '../assets/photo14.png';
import Photo15 from '../assets/photo15.png';
import Photo16 from '../assets/photo16.png';
import Photo161 from '../assets/photo16-1.png';
import Photo162 from '../assets/photo16-2.png';
import Photo163 from '../assets/photo16-3.png';
import Photo164 from '../assets/photo16-4.png';
import Title1 from '../assets/title1.png';
function Products() {
  const settings = {
    className: "center",
    centerMode: true,
    infinite: true,
    centerPadding: "60px",
    slidesToShow: 3,
    speed: 500,
  
  };
  const CustomPrevArrow = (props) => {
    const { onClick } = props;
    return (
      <button className="slick-prev" onClick={onClick} style={{ backgroundColor: 'purple' }}>
        Previous
      </button>
    );
  };

  // Özel sağ ok butonu bileşeni
  const CustomNextArrow = (props) => {
    const { onClick } = props;
    return (
      <button className="slick-next" onClick={onClick} style={{ backgroundColor: 'purple' }}>
        Next
      </button>
    );
  };

  return (
    <div className=' md:px-12 p-4 max-w-screen-2xl mx-auto mt-28 '  id="Products">
    <div className=' gradiantbg rounded-xl rounded-br-[80px] flex flex-col md:flex-row-reverse justify-between items-center gap-10 px-5'>
<div className='md:w-3/5'>
          <h2 className='md:text-7xl text-4xl  font-bold text-white mb-6 leading-relaxed'>Develop your skills without diligence</h2>
        <p className='text-[#EBEBEB] text-2xl mb-8'>A good example of a contains  a topic sentence ,details amd a conculasion.
          There are many differente kinds of animals that live in China
        </p>
        <div className='space-x-5 space-y-4'>
          <button className=' mb-2 py-3 px-8 bg-purple-700 font-semibold text-white rounded hover:bg-purple-600 transition-all duration-300'>Get Started</button>
          <button className=' mb-2 py-3 px-8 bg-purple-700 font-semibold text-white rounded hover:bg-purple-600 transition-all duration-300'>Discount</button>
        </div>
        </div>
       </div>

       <div><img src ={Photo13}/></div>
       <div><img src ={Photo14}/></div>


<div className="relative mt-4">
  
  <img src={Photo15} className="w-full h-auto" alt="Alt Resim" />
 
  <img className='absolute top-8 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-[500px] object-cover' src={Title1} alt="Title Image" />
  <div className="flex absolute top-0 left-0 w-16 md:w-32 lg:w-48  gap-4 ml-10 mt-28" alt="Üst Resim">
<img src={Photo161} className="w-24 sm:w-auto h-auto" alt="Alt Resim" />
<img src={Photo162} className="w-24 sm:w-auto h-auto" alt="Alt Resim" />
<img src={Photo163} className="w-24 sm:w-auto h-auto" alt="Alt Resim" />
<img src={Photo164} className="w-24 sm:w-auto h-auto" alt="Alt Resim" />
</div>  


</div>
<div className='w-[900px] m-auto slider-container mt-4'>
<Slider  {...settings} prevArrow={<CustomPrevArrow className='bg-purple-900'/>} nextArrow={<CustomNextArrow />}>
  <div>
    <img  src={Uber} alt="Resim 1" />
  </div>
  <div>
    <img  src={Tules} alt="Resim 2" />
  </div>
  <div>
    <img  src={Dubai} alt="Resim 3" />
  </div>
  <div>
    <img  src={Emirates} alt="Resim 4" />
  </div>
  <div>
    <img  src={Du} alt="Resim 4" />
  </div>
  <div>
    <img  src={Accenture} alt="Resim 4" />
  </div>

 
</Slider>
</div>




<Accordion collapseAll>
  <Accordion.Panel>
    <Accordion.Title>Title 1</Accordion.Title>
    <Accordion.Content>
      <p>Content 1</p>
    </Accordion.Content>
  </Accordion.Panel>
  <Accordion.Panel>
    <Accordion.Title>Title 2</Accordion.Title>
    <Accordion.Content>
      <p>Content 2</p>
    </Accordion.Content>
  </Accordion.Panel>
  <Accordion.Panel>
    <Accordion.Title>Title 3</Accordion.Title>
    <Accordion.Content>
      <p>Content 3</p>
    </Accordion.Content>
  </Accordion.Panel>
</Accordion>






</div>
       
      
  )
}

export default Products
